import React, { useState } from 'react';
import Sidebar from './Sidebar'; // Import the Sidebar component
import RegistrationForm from './Signup';

const AdminPage = () => {
  const [pageTitle, setPageTitle] = useState('Admin Dashboard');

  const handlePageChange = (title) => {
    setPageTitle(title);
  };

  return (
    <div>
      {/* Displaying the Sidebar component with pageTitle prop */}
      <Sidebar pageTitle={pageTitle} onPageChange={handlePageChange} />
      <h2>{pageTitle}</h2>
      <RegistrationForm />
    </div>
  );
};

export default AdminPage;
